function Button() {
    let buttonArray = ['C', '/', '*', 7, 8, 9, '-', 4, 5, 6, '+', 1, 2, 3, '0', '00', '.', '='];
    const buttonArrayHtml = buttonArray.map((btn) => {
        <span class="num"><i> btn </i></span>
    });
    return (
        {buttonArrayHtml}
    );
}
export {Button};
